          import React, { useState } from 'react';

function Calculator() {
  const [input, setInput] = useState('');

  const handleClick = (value) => {
    setInput(input + value);
  };

  const handleClear = () => {
    setInput('');
  };

  const handleCalculate = () => {
    try {
      // Evaluate the expression
      setInput(String(eval(input)));
    } catch {
      setInput('Error');
    }
  };

  return (
    <div style={{ maxWidth: '200px', margin: 'auto' }}>
      <h2>Calculator</h2>
      <input
        type="text"
        value={input}
        readOnly
        style={{ width: '100%', height: '30px', fontSize: '1.2em', textAlign: 'right' }}
      />
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {['7', '8', '9', '+', '4', '5', '6', '-', '1', '2', '3', '*', '0', '.', '=', '/'].map((btn) => (
          <button
            key={btn}
            onClick={() => btn === '=' ? handleCalculate() : handleClick(btn)}
            style={{ width: '50px', height: '50px', margin: '5px', fontSize: '1em' }}
          >
            {btn}
          </button>
        ))}
        <button onClick={handleClear} style={{ width: '105px', height: '50px', margin: '5px', fontSize: '1em' }}>
          Clear
        </button>
      </div>
    </div>
  );
}

export default Calculator;
